import styled from "styled-components";

export const ArrowRight = styled.span`
  background-image: url("/images/icons.png");
  background-size: 440px 411px;
  background-position: -402px -207px;
  width: 24px;
  height: 24px;
  /* transform: scaleX(-1); */
  transform: rotate(180deg);
  display: block;
`;
